import React from "react";

const Navbar = () => {
  return (
    <div className="navbar-container">
      <div className="navbar-content">
        <div className="logo">
          <h1>
            <span>3</span>Brother's
          </h1>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
